// src/axiosConfig.js
import axios from 'axios';

const api = axios.create({
  baseURL: 'http://127.0.0.1:5000',  // Defina a URL do backend Flask
  headers: {
    'Content-Type': 'application/json',  // Assegure-se de que o tipo de conteúdo seja JSON
  },
});

export default api;
